import React, {useContext} from "react";
import { CartContext } from "../Store/CartContext";

const Cart = (item) => {
    const {cartItems} = useContext(CartContext);
    return (
        <>
        <ul key={item.id}>
            {cartItems.map(item =>(
                <>
                    <li>{item.title}</li>
                    <li>{item.price}</li>
                </>
            ))}
        </ul>
        </>
    )
}

export default Cart
